import "./MyDiarys.css"
const MyDiarys = () => {
  return(
  <div className="diarys">
    <div className="diary-btn">
      <span className="diary-name">
        Food tracking
      </span>
    </div>
    <div className="add-diary-btn">
    <i class="fi fi-rr-add"></i>
    </div>
  </div>)
};
export default MyDiarys;
